import React, { Component } from "react";
import { TestingPart } from "../../components/testingpart/testingpart";
import { Link } from "react-router-dom";

class Test extends Component {

    render(){
        return(
            <div className="container">
                <div className="jumbotron">
                    <h1>It is the Validation page</h1>
                    <p>Instruction: Please enter your email so that we can check before your vote
                    </p>
                    <button onClick={this.startTest}>Confirm</button>
                    <Link to="/">Go Back Home</Link>

                </div>
            </div>

        )
    }
}

export default Test;
